import React from "react";
import settings from "../../../src/assets/Icons/settings.jpg";
export default function Swap() {
  return (
    // center div with glassmorphism
    <div
      className="container"
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "40vh",
        width: "30vw",
        //glassmorphism with black background

        //add black glass effect

        //add border
        border: "1px solid rgba(255, 255, 255, 0.2)",
        //add blur
        backdropFilter: "blur(4px)",
        //rounded corners
        borderRadius: "10px",
      }}>
      <div className="row">
        <div className="col-9">
          <h5 className="text-white">Music-Exchanger</h5>
        </div>
        <div className="col-4">
          <img
            src={settings}
            width="50"
            height="50"
            className="d-inline-block align-top"
            alt="Mudex logo"
          />
        </div>
      </div>
    </div>
  );
}
